var makeFindVideosByUserUseCase = () => {
  const prisma2 = new PrismaService;
  const videosService = new VideosService(prisma2);
  return new FindVideosByUserUseCase(videosService);
};

// src/modules/videos/infra/http/controllers/get-videos-by-user.controller.ts
var findVideosByUserUseCase = makeFindVideosByUserUseCase();
var getVideosByUserController = new Elysia().use(authGuard).get("/tiktok/videos/user/:userId", async ({ user }) => {
  return await findVideosByUserUseCase.execute(user.id);
}, {
  params: t.Object({
    userId: t.String({ minLength: 1 })
  }),
  auth: true
});

// src/modules/videos/routes/route.ts
var videosRoutes = new Elysia().use(createVideoController).use(getVideosByUserController);

// src/modules/routes/route.ts
var routes = new Elysia().use(integrationsRoutes).use(tiktokRoutes).use(videosRoutes);

// src/index.ts
var app = new Elysia().use(index_default({
  origin: env6.FRONTEND_URL,
  methods: ["GET", "POST", "PUT", "DELETE", "OPTIONS"],
  credentials: true,
  allowedHeaders: ["Content-Type", "Authorization"]
})).mount(auth.handler).use(routes).listen(env6.PORT);
console.log(`API running at ${app.server?.hostname}:${app.server?.port}`);
